(def static-vega-heatmap 
{:name "treemap", :width 960, :height 500, :padding 2.5,
 :data [{:name "tree", :value flare, :format {:type "treejson"}, 
         :transform [{:type "treemap", :value "data.size"}]}], 
 :scales [{:name "color", :type "ordinal", 
           :range ["#3182bd" "#6baed6" "#9ecae1" "#c6dbef" "#e6550d" "#fd8d3c" "#fdae6b" "#fdd0a2" "#31a354" "#74c476" "#a1d99b" "#c7e9c0"
                   "#756bb1" "#9e9ac8" "#bcbddc" "#dadaeb" "#636363" "#969696" "#bdbdbd" "#d9d9d9"]} 
          {:name "size", :type "ordinal", :domain [0 1 2 3], :range [256 28 20 14]} 
          {:name "opacity", :type "ordinal", :domain [0 1 2 3], :range [0.15 0.5 0.8 1.0]}], 
 :marks [{:type "rect", :from {:data "tree", :transform [{:type "filter", :test "d.values"}]}, :interactive false, 
          :properties {:enter {:x {:field "x"}, :y {:field "y"}, 
                               :width {:field "width"}, :height {:field "height"}, 
                               :fill {:scale "color",  :field "data.name"}}}} 
         {:type "rect", :from {:data "tree", :transform [{:type "filter", :test "!d.values"}]},
          :properties {:enter {:x {:field "x"}, :y {:field "y"},
                               :width {:field "width"}, :height {:field "height"},
                               :stroke {:value "#fff"}}, :update {:fill {:value "rgba(0,0,0,0)"}}, :hover {:fill {:value "red"}}}} 
         {:type "text", :from {:data "tree", :transform [{:type "filter", :test "d.values"}]}, :interactive false,
          :properties {:enter {:y {:field "y"}, :baseline {:value "middle"},
                               :align {:value "center"},
                               :dx {:field "width",
                                    :mult 0.5},
                               :fill {:value "#000"}, :dy {:field "height", :mult 0.5},
                               :fillOpacity {:scale "opacity", :field "depth"}, :font {:value "Helvetica Neue"},
                               :x {:field "x"}, :fontSize {:scale "size", 
                                                           :field "depth"}, :text {:field "data.name"}}}}]})
